window.bookSummaryJSON = "<p><b>INTERNATIONAL BESTSELLER • Inspector Harry Hole pursues an assassin bent on revenge in this “fast-and-furious” installment (</b><b><i>The New York Times Book Review</i></b><b>) of the bestselling series. </b><br> <br> Shots ring out at a Salvation Army Christmas concert in Oslo, leaving one of the singers dead in the street. The trail will lead Harry Hole, Oslo’s best investigator and worst civil servant, deep into the darkest corners of the city and, eventually, to Croatia. <br> <br> An assassin forged in the war-torn region has been brought to Oslo to settle an old debt. As the police circle in, the killer becomes increasingly desperate and the danger mounts for Harry and his colleagues.<br> <br> <b>Don't miss Jo Nesbo's latest Harry Hole thriller, </b><b><i>Killing Moon</i></b><b>!</b></p>"; 
